column8:
●Bluetooth内蔵のスマートフォン、iPhone、携帯電話機とワイヤレス接続でつなぎ、音楽転送とハンズフリー通話がご利用になれます。<br>●AMP回路内蔵なので、Bluetoothで受けた音楽ファイルをパワフルに増幅して出力する事が可能です。<br>●スマホから無線転送された音源をAMPで高出力化し、有線での高音質のままAUX端子を通して転送可能です。<br>●DC充電器には5V/MAX2.4AのUSBポート付きで、同時にスマートフォンなどを充電できます。<br><br>メーカー：セイワ<br>品番：BT590<style type="text/css">
