■メーカー名：ミラリード<br>■商品名：ブルートゥースヘッドセット(USBダイレクト充電)SL<br>■品番：PB-1603<br><br>■新機構を搭載したBluetoothイヤホンで、USBポートに直差しでき充電用クレードルは必要ありません<br>■使いやすい軽量コンパクト設計で、Bluetooth搭載のスマートフォンなどでハンズフリーでの通話対応が可能(操作可能距離：約10m以内)<br>■イヤーフックは不要で、フリーサイズイヤーパットでしっかりフィットするので今までにない自然な装着感<br><br>【仕様】<br>■最大通話時間：約5時間<br>■最大待ち受け時間：約40時間<br>※時間は電波状況などや条件によって異なります。<br>■充電時間：1.5時間<style type="text/css">
